-- Создаем схему bank
CREATE SCHEMA bank;
COMMENT ON SCHEMA bank IS 'Банк "RuBank"';

CREATE SCHEMA public;
COMMENT ON SCHEMA public IS 'standard public schema';

CREATE EXTENSION IF NOT EXISTS plpgsql WITH SCHEMA pg_catalog;
COMMENT ON EXTENSION plpgsql IS 'PL/pgSQL procedural language';

SET search_path = bank, pg_catalog;

SET default_tablespace = '';

SET default_with_oids = false;




-- Создаем таблицу клиентов
CREATE TABLE bank.clients (
    client_id SERIAL PRIMARY KEY, -- Уникальный идентификатор с автоинкрементом
    name TEXT NOT NULL,           -- Имя клиента
    address TEXT NOT NULL,                 -- Адрес
    passport VARCHAR(11) UNIQUE NOT NULL, -- Номер паспорта, уникальный
    inn VARCHAR(12) UNIQUE NOT NULL,  -- ИНН, уникальный
    phone TEXT NOT NULL,                   -- Номер телефона
    contact_info JSONB,           -- Контактная информация в формате JSONB
    client_type TEXT NOT NULL CHECK (client_type IN ('физическое лицо', 'юридическое лицо')), -- Тип клиента
    status TEXT NOT NULL CHECK (status IN ('активный', 'неактивный'))         -- Статус клиента
);


-- Создаем таблицу счетов
CREATE TABLE bank.accounts (
    account_num VARCHAR(34) PRIMARY KEY, -- Номер счета
    client_id INT NOT NULL, -- Внешний ключ, ссылающийся на клиентов
    cur_id SMALLINT NOT NULL,                 -- Идентификатор валюты
    issue_date DATE NOT NULL,                 -- Дата открытия счета
    balance DECIMAL(20,4) NOT NULL CHECK (balance >= 0), -- Баланс счета
    status TEXT NOT NULL CHECK (status IN ('открыт', 'закрыт')), -- Статус счета
    close_date DATE                  -- Дата закрытия счета
);


-- Создаем таблицу транзакций
CREATE TABLE bank.transactions (
    transaction_id SERIAL PRIMARY KEY, -- Уникальный идентификатор транзакции
    prpl_account_num VARCHAR(34) NOT NULL, -- Счет принципала
    cur_id SMALLINT NOT NULL,                 -- Идентификатор валюты
    date DATE NOT NULL,                       -- Дата транзакции
    bene_account_num VARCHAR(34) NOT NULL,        -- Счет бенефициара
    type TEXT NOT NULL CHECK (type IN ('внутренняя', 'международная')), -- Тип транзакции
    amount DECIMAL(20, 4) NOT NULL CHECK (amount > 0), -- Сумма транзакции
    commission DECIMAL(14, 4) NOT NULL CHECK (commission >= 0),              -- Комиссия
    status TEXT NOT NULL CHECK (status IN ('отправлена', 'доставлена', 'отменена')),                     -- Статус транзакции
    bank_cor_swift VARCHAR(11)  -- SWIFT код банка-корреспондента
);


-- Создаем таблицу кредитов
CREATE TABLE bank.loans (
    loan_id SERIAL PRIMARY KEY,      -- Уникальный идентификатор кредита
    client_id INT NOT NULL, -- Внешний ключ, ссылающийся на клиентов
    amount DECIMAL(20, 4) NOT NULL CHECK (amount > 0), -- Сумма кредита
    interest_rate DECIMAL(10, 6) NOT NULL,           -- Процентная ставка
    issue_date DATE NOT NULL,                 -- Дата выдачи кредита
    maturity_date DATE NOT NULL,              -- Дата погашения кредита
    status TEXT NOT NULL,                     -- Статус кредита
    terms TEXT                       -- Условия кредита
);


-- Создаем таблицу депозитов
CREATE TABLE bank.deposits (
    deposit_id SERIAL PRIMARY KEY,   -- Уникальный идентификатор депозита
    client_id INT NOT NULL,  -- Внешний ключ, ссылающийся на клиентов
    cur_id SMALLINT NOT NULL,                 -- Идентификатор валюты
    issue_date DATE NOT NULL,                 -- Дата открытия депозита
    amount DECIMAL(20, 4) NOT NULL CHECK (amount > 0), -- Сумма депозита
    interest_rate DECIMAL(10, 6) NOT NULL,           -- Процентная ставка
    maturity_date DATE NOT NULL,              -- Дата окончания депозита
    status TEXT NOT NULL                     -- Статус депозита
);

-- Создаем таблицу сотрудников
CREATE TABLE bank.personnel (
    employee_id SERIAL PRIMARY KEY,  -- Уникальный идентификатор сотрудника
    branch_id SMALLINT NOT NULL, -- Внешний ключ, ссылающийся на отделения
    name TEXT NOT NULL,                       -- Имя сотрудника
    position TEXT NOT NULL,                   -- Должность
    contact_info JSONB UNIQUE NOT NULL,              -- Контактная информация в формате JSON
    salary DECIMAL(10, 2) NOT NULL CHECK (salary > 0) -- Зарплата
);

-- Создаем таблицу отделений
CREATE TABLE bank.branches (
    branch_id SMALLINT PRIMARY KEY,  -- Уникальный идентификатор отделения
    head SMALLINT NOT NULL, -- Внешний ключ, ссылающийся на руководителя
    address TEXT NOT NULL,                    -- Адрес отделения
    region TEXT NOT NULL,                     -- Регион
    phone TEXT UNIQUE NOT NULL                   -- Номер телефона
);


-- Создаем таблицу банков-корреспондентов
CREATE TABLE bank.banks_cors (
    cur_id SMALLINT NOT NULL,                 -- Идентификатор валюты
    swift_code VARCHAR(11) PRIMARY KEY,  -- SWIFT код банка
    name VARCHAR(50) NOT NULL,                    -- Название банка
    address VARCHAR(100) NOT NULL,                 -- Адрес банка
    contact_info JSONB NOT NULL               -- Контактная информация в формате JSON
);


-- Создаем таблицу курсов валют
CREATE TABLE bank.daily_rates (
    cur_id SMALLINT NOT NULL,                 -- Идентификатор валюты
    date DATE NOT NULL,                        -- День
    cur_name VARCHAR(3),                -- Название валюты
    rate_source VARCHAR(4),             -- Источник курса
    rate DECIMAL(20, 6) CHECK (rate > 0),  -- Курс валюты
    PRIMARY KEY (cur_id, date)        -- Составной ключ
);

CREATE MATERIALIZED VIEW bank.transactions_rub AS
SELECT 
    t.transaction_id,
    t.prpl_account_num,
    t.cur_id,
    t.date,
    t.bene_account_num,
    t.type,
    t.amount,
    t.commission,
    t.status,
    t.bank_cor_swift,
    -- Рассчитываем сумму в рублях
    CASE 
        WHEN t.cur_id = 643 THEN t.amount -- 643 - код рубля
        ELSE t.amount * r.rate
    END AS amount_rub
FROM 
    bank.transactions t
LEFT JOIN bank.daily_rates r ON t.cur_id = r.cur_id AND t.date = r.date;

